	add("philerast", "{\"term\":\"philerast\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027φιλεραστής\u0027 from \u0027φίλος\u0027 or \u0027φιλέω\u0027 + \u0027ἐραστής\u0027 (lover) (compare the English cognates \u0027phil-\u0027 + \u0027erastes\u0027 ; \u0027φιλεραστής\u0027 was used by w:Plato|Plato in his w:Symposium (Plato)|Symposium as an alternative to \u0027ἐρώμενος\u0027 (eromenos) to imply greater equitability and reciprocity and to avoid the latter term’s denotational passivity.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A boy who feels \u0027philia\u0027 or, more specifically, anterōs\u0027 for his paederastic lover\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1924\u0027\u0027: Plato et alii, \u0027w:Symposium Symposium\u0027, [http://books.google.co.uk/books?id\u003diqtJAAAAIAAJ\u0026amp;q\u003d%22philerasts%22\u0026amp;dq\u003d%22philerasts%22\u0026amp;pgis\u003d1 page 40\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"When in turn they reach man’s estate they love youths themselves[; i]n general terms such people are either paiderasts or \u0027\u0027philerasts\u0027\u0027, being always attracted by kindred kind. But when a boy-lover, or any other, chances to meet his own original half, they are both seized with an ecstasy of affection and intimacy and love, and can hardly bear to be separated for as much as a single instant from each other\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027: David M. Halperin, \u0027One hundred years of homosexuality: and other essays on Greek love\u0027, [http://books.google.co.uk/books?id\u003dR26GAAAAIAAJ\u0026amp;dq\u003d%22philerasts%22\u0026amp;q\u003d%22paederast+and+philerast%22\u0026amp;pgis\u003d1 page 20\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"“while they are still boys [i.e., pubescent or pre-adult], they are fond of men, and enjoy lying down together with them and twining their limbs about them, . . . but when they become men they are lovers of boys. . . . Such a man is a paederast and \u0027\u0027philerast\u0027\u0027 [i.e., fond of or responsive to adult male lovers]” at \u0027different stages of his life\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027: “[http://groups.google.co.uk/groups/profile?hl\u003den\u0026amp;enc_user\u003d29p0zhgAAADgQDOL6XTNkyEzaSdGZ54wTE1ck5LHiTxsohY2WCyEBQ Leo]”, \u0027[http://groups.google.co.uk/group/uk.politics.misc/topics?hl\u003den uk.politics.misc (Google group)]: [http://groups.google.co.uk/group/uk.politics.misc/browse_thread/thread/71ed399755938f9b/22c507232863fa3f?hl\u003den\u0026amp;q\u003dphilerast Broome House: Paedophiles]\u0027, the 31st day of August at 8 o’clock a.m\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The Ancient Greeks] also had a word which can be rendered ‘\u0027\u0027philerast\u0027\u0027’, meaning a boy who loves his lover\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027: Thomas H. Luxon, \u0027Single Imperfection: Milton, Marriage, and Friendship\u0027, [http://books.google.co.uk/books?ei\u003d8rQCSszmEqKuzATPhfjsDw\u0026amp;id\u003du5tlAAAAMAAJ\u0026amp;dq\u003d%22philerast%22\u0026amp;q\u003d%22Eve+the+philerast%22\u0026amp;pgis\u003d1 page 140\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Milton strained to redefine marriage as the friendship Socrates recommended — an erotics beyond the sexual. As a result, his notion of marriage sometimes looks a lot like a heteroerotic paederasty, with Adam as the paederast and Eve the \u0027\u0027philerast\u0027\u0027 destined never to outgrow the role of student and beloved\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"For more examples of the usage of this term see this entry’s citations page as well as the citations page for\u0027 philerast\", \"priority\":10}]}, \"synonyms\":{}}");

	add("philia", "{\"term\":\"philia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"friendship (\u0027translating Greek\u0027 φιλία \u0027in Aristotle\u0027s\u0027 w:Nicomachean Nicomachean Ethics\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"likin\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a psychological disorder characterized by an irrational favorable disposition towards something\", \"priority\":3}]}, \"synonyms\":{}}");

	add("philippa", "{\"term\":\"philippa\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"A Latinate feminine form of Philip, recorded in medieval England, but originally pronounced like the masculine form.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1854\u0027\u0027 w:John Esten John Esten Cooke, \u0027The Youth of Jefferson\u0027, Redfield (1854), page 22\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"quot;You detest every thing insincere, I know, charming \u0027\u0027Philippa\u0027\u0027 — pardon me, your beautiful name betrays me constantly. Is it not — like your voice — stolen from poetry or music?\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1963\u0027\u0027 Jane McIlvaine, \u0027Cammie\u0027s Cousin\u0027, Bobbs-Merrill, page 58\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"They had an expensive, well-cut air which was like a uniform, and their conversation was all about people with names like Terence and Geoffrey, \u0027\u0027Philippa\u0027\u0027 and Vivien, who lived in London and County Wicklow and who were \u0026quot;terribly amusing\u0026quot\", \"priority\":4}]}, \"synonyms\":{}}");

	add("philippians", "{\"term\":\"philippians\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The eleventh book of the New Testament of the Bible, the epistle of w:Saint St Paul to the Philippians\", \"priority\":1}]}, \"synonyms\":{}}");

	add("philippic", "{\"term\":\"philippic\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"Latin \u0027philippicus\u0027 from Ancient greek (to 1453) \u0027φιλιππικος\u0027 from \u0027φιλιππος\u0027 (lover of horses) from \u0027φιλο-\u0027 + \u0027ίππος\u0027 (horse)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of the discourses of Demosthenes against w:Philip II of Philip II of Macedon, defending the liberty of Athens\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any tirade or declamation full of bitter condemnation\", \"priority\":2}]}, \"synonyms\":{}}");

	add("philippines", "{\"term\":\"philippines\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\"], \"text\":\"See {{projectlink|wikipedia|Name of the Philippines}} for a complete etymology.From Spanish {{m|es|Filipinas}}, from {{m|es|Felipe}}, the name of a King of {{m|en|Spain}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The Republic of the Philippines, a Southeast Asian country comprised of over seven thousand islands in the Pacific Ocean, composed of the Philippine archipelago\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The Philippine Islands, an archipelago in Southeast Asia, that forms the basis of the Philippine republic\", \"priority\":2}]}, \"synonyms\":{}}");

	add("philistine", "{\"term\":\"philistine\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\", \"ancient greek (to 1453)\", \"Hebrew\"], \"text\":\"From \u0027philistinus\u0027 from Late Ancient greek (to 1453) \u0027φυλιστῖνοι\u0027 from Hebrew \u0027פְּלִשְׁתִּים\u0027 from \u0027פְּלֶשֶׁת\u0027 (philistia) The sense relating to lack of education and culture was introduced to English by w:Thomas Carlyle|Thomas Carlyle and greatly popularised by w:Matthew Arnold|Matthew Arnold. It is derived from German student use of the term \u0027philister\u0027 () to refer to the burghers of the town. This apparently derived from the use of the biblical text \u0026quot;the Philistines be upon you, Samson\u0026quot; in a memorial service for a Jena university student who died as the result of a w:Town and gown|town versus gown dispute in 1693.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person from ancient Philistia\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Then the lords of the \u0027\u0027Philistines\u0027\u0027 gathered them together for to offer a great sacrifice unto Dagon their god, and to rejoice\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d2|passage\u003dSunning himself on the board steps, I saw for the first time Mr. Farquhar Fenelon Cooke. He was dressed out in broad gaiters and bright tweeds, like an English tourist, and his face might have belonged to Dagon, idol of the \u0027\u0027Philistines\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A person who lacks appreciation of art or culture\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1843\u0027\u0027 , \u0027:w:Past and Present Past and Present\u0027, book 2, ch. 4, \u0027Abbot Hugo\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"what could poor old Abbot Hugo do? A frail old man; and the \u0027\u0027Philistines\u0027\u0027 were upon him, – that is to say, the Hebrews\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, \u0027Sophist\u0027. Translation by Lesley Brown. w:Stephanus 259d\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"trying to separate everything from everything else is not just poor taste but is the mark of a total \u0027\u0027philistine\u0027\u0027 and someone with no feeling for philosophy\", \"priority\":8}]}, \"synonyms\":{}}");

	add("phillipsite", "{\"term\":\"phillipsite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mineral of the zeolite group, a hydrated potassium, calcium and aluminium silicate with monoclinic crystals\", \"priority\":1}]}, \"synonyms\":{}}");

	add("phillumenist", "{\"term\":\"phillumenist\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From {{prefix|phil|lang\u003den|t1\u003dlove of}} Latin \u0027lumen\u0027 (light) {{suffix||ist|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who collects match-related items, like matchbox labels, matchboxes, matchbooks, or matchbook covers\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"is a new and happy breed, the \u0027\u0027Phillumenists\u0027\u0027, better known as Match-box Label collectors\", \"priority\":2}]}, \"synonyms\":{}}");

	add("phillumeny", "{\"term\":\"phillumeny\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From {{prefix|phil|lang\u003den}} Latin \u0027lang\u003dla|lumen\u0027 () {{suffix||y|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The hobby of collecting matchbox labels and other match-related items\", \"priority\":1}]}, \"synonyms\":{}}");

	add("philodox", "{\"term\":\"philodox\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027philodoxe\u0027 from Ancient greek (to 1453) \u0027lang\u003dgrc|φιλόδοξος\u0027 () compound of \u0027lang\u003dgrc|φίλο-\u0027 () + \u0027lang\u003dgrc|δόξα\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person with an excessive interest in his own opinions\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"II.12\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And no people are lesse Philosophers and more foolish, than \u0027Platoes\u0027 \u0027\u0027Philodoxes\u0027\u0027, or lovers of their owne opinions\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Heiner Bielefeldt, \u0027Symbolic Representation in Kant’s Practical Philosophy\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"This, however, is a difficult task that only a true philosopher, and not a mere \u0027\u0027philodox\u0027\u0027, will be willing to tackle\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Charles Harrington Elster, \u0027There’s a Word for It!: A Grandiloquent Guide to Life\u0027, p.\u0026lt;small\u0026gt;UNKNOWN\u0026lt;/small\u0026gt; (perhaps blurb\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Consider that without realizing it you may have engaged in acokoinonia (sex without passion or desire), been bored to tears by the company of a \u0027\u0027philodox\u0027\u0027 (someone in love with his or her opinions), or suffered from recurrent matutolypea (getting up on the wrong side of the bed\", \"priority\":7}]}, \"synonyms\":{}}");

	add("philography", "{\"term\":\"philography\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"from Greek: \u0027φιλοσ\u0027 (\u0027philos\u0027) \u003d love + \u0027γραφη / γραφω\u0027 (\u0027graphe / grapho\u0027) \u003d writing (ie. written works) / to write\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An academic discipline of all forms and styles of writin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A love for writing\", \"priority\":2}]}, \"synonyms\":{}}");

